    productId:number,
    productName:string,
    isFeatured:boolean,
    productBrand:string,
    rating:number,
    productImage?: String,
    productPrice:Number

}[]=[
{
    productId:1,
    productName:productDetails.appleWatchName,
    isFeatured:true,
    productBrand:productDetails.appleBrand,
    rating:4,
    productPrice:14000,
    productImage:image.appleAirpods,

},
]
export default CardItemDetails;
